import React from "react";
import User from './images/user.png'

function App() {
  return (
    <div className="bg-white">
      <nav className="bg-white position-fixed">
        <div  className="h-10  flex  justify-end">
          <img src={User} className="mt-4 mr-40"/>
        </div>  
        <p>Hello</p>
      </nav>
    </div>
  );
}

export default App;
